import React from "react";
import "../App.css";
export default function Profile(props) {
  return (
    <div className="profile">
      <img className="photo" src={props.image} alt="avatar" />

      <h1>{props.name}</h1>
      <p>{props.job}</p>
    </div>
  );
}

